from typing import Optional

class Node:

    def __init__(self, data):
        self.data = data
        self.left = None
        self.right = None

def construct_tree_from_string(s: str) -> Optional['']:
    if not s:
        return None
    stack = [Node('')]
    for x in s:
        if x == '(':
            n = Node('')
            if stack[-1].left:
                stack[-1].right = n
            else:
                stack[-1].left = n
            stack.append(n)
        elif x == ')':
            stack.pop()
        else:
            stack[-1].data += x
    return stack[0]

